import './App.css';

function App() {
  return (
    <div className="App">
      <>
        <article>
          <h1>โปรแกรม รายรับ - รายจ่าย</h1>
          <p>บันทึกข้อมูลในแต่ละวัน</p>
          <ul>
              <li>ค่าเดินทาง <span>-200</span></li>
              <li>เงินเดือน <span>+20,00</span></li>
              <li>เงินค่าอาหาร <span>-500</span></li>
          </ul>
        </article>
      </>
    </div>
  );
}

export default App;
